(13, '183994e60c863da927dcb7eededa3503.png', 'd0dee5f8dd556c282cc43f0186925160.png', 'Learning', 'The word learning is used routinely in discussions about teaching in higher education, so it’s important to clarify what we are referring to when we talk about learning. Educational researchers agree that learning is much deeper than memorization and information recall. Deep and long-lasting learning involves understanding, relating ideas and making connections between prior and new knowledge, independent and critical thinking and ability to transfer knowledge to new and different contexts.', 'تعلم', 'يتم استخدام كلمة التعلم بشكل روتيني في المناقشات حول التدريس في التعليم العالي ، لذلك من المهم توضيح ما نشير إليه عندما نتحدث عن التعلم. يتفق الباحثون التربويون على أن التعلم أعمق بكثير من الحفظ واسترجاع المعلومات. يتضمن التعلم العميق والطويل الأمد الفهم والربط بين الأفكار وإقامة روابط بين المعرفة السابقة والجديدة والتفكير المستقل والناقد والقدرة على نقل المعرفة إلى سياقات جديدة ومختلفة.', 1, '2019-10-11', 'U00000000001', '0000-00-00', '', 10, 'https://chawtechsolutions.co.in/mamnoonak/uploads/'),
